// Resort component 
import React from 'react'
// Bootstrap
import 'bootstrap/dist/css/bootstrap.min.css';
import { Container, Row, Col } from 'react-bootstrap';

// ***HARD CODED FOR TESTING***
// Default return for resort component 
const Resort = () => {
    return (
        <Container>
            <Row>
                <Col col-4>1</Col>
                <Col>2</Col>
            </Row>
        </Container>
    );
};

export default Resort
